import React from 'react'
import Accordion from '../components/Accordion'

const ITEMS = [
  {
    id: 'q1',
    label: 'How do I create an account?',
    content:
      'Click the "Sign Up" button in the top right corner and follow the registration process.',
  },
  {
    id: 'q2',
    label: 'I forgot my password. What should I do?',
    content:
      'Click on "Forgot Password" on the login page and follow the instructions sent to your email.',
  },
  {
    id: 'q3',
    label: 'How do I update my profile information?',
    content:
      'Go to "My Account" settings and select "Edit Profile" to make changes.',
  },
  // （可选）为某一项加自定义渐变配色，示例：
  // {
  //   id: 'q4',
  //   label: 'Custom gradient example',
  //   content: 'This item has its own gradient.',
  //   gradient: 'from-purple-600 to-blue-500 hover:from-purple-700 hover:to-blue-600',
  // },
]

const AccordionPage = () => {
  return (
    <div>
      <h1>Accordion Page</h1>
      <Accordion items={ITEMS} />
    </div>
  )
}

export default AccordionPage
